// src/Components/Assests/employee/pages/DashBoard.jsx
import React from 'react';

const DashBoard = () => {
  return (
    <div className="dashboard-content">
      <h2 className="centered-heading">Employee Dashboard</h2>
      <p>Overview of employee-specific functionalities and quick access.</p>
      <div className="quick-links">
        <h3>Quick Links</h3>
        <ul>
          <li><a href="/request-question-bank">Request Question Bank</a></li>
          <li><a href="/self-assessment">Self-Assessment</a></li>
          <li><a href="/submit-feedback">Submit Feedback</a></li>
          <li><a href="/learning-development">Learning and Development</a></li>
          <li><a href="/request-learning-plan">Request Learning Plan</a></li>
          <li>Notifications</li>
        </ul>
      </div>
    </div>
  );
};

export default DashBoard;
